import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import fb from "./";
function Footer(){
    const fb = <Ikona url={fb}/>
    return(
        
            <footer>
                <div id="tekst">
                    <HorizontalnaLista prvi="ABOUT" drugi="TEAM" treci="CONTACT"/>
                </div>
                <div id="ikone">
                    <HorizontalnaLista prvi="nnnok" drugi="njfnd"/>
                </div>
            </footer>
       
    );
}

export default Footer;
